import { createTheme } from "@mui/material";

const theme = createTheme({
  typography: {
    h1: {
      fontFamily: "Roboto",
    },
    h2: {
      fontFamily: "Roboto",
    },
    h3: {
      fontFamily: "Roboto",
    },
    h4: {
      fontFamily: "Roboto",
    },
    p: {
      fontFamily: "Roboto Mono",
    },
  },
});

export default theme;
